// Dboard.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Dboard = () => {
  const [locks, setLocks] = useState('');
  const [lockers, setLockers] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Get locks and lockers data from localStorage
    const savedLocks = localStorage.getItem('locks');
    const savedLockers = localStorage.getItem('lockers');

    // If data exists, update state
    if (savedLocks && savedLockers) {
      setLocks(savedLocks);
      setLockers(savedLockers);
    } else {
      // Redirect to login if data is missing (e.g., user not logged in)
      navigate('/');
    }
  }, [navigate]);

  return (
    <div className="dashboard-container">
      <h2>Welcome to the Smart Parcel Locker Dashboard</h2>
      <div className="dashboard-info">
        <div>
          <h3>No. of Locks: </h3>
          <p>{locks}</p>
        </div>
        <div>
          <h3>No. of Lockers: </h3>
          <p>{lockers}</p>
        </div>
      </div>
    </div>
  );
};

export default Dboard;
